import React from 'react';
import { Link } from 'react-router-dom'; // Assuming you're using react-router for routing

const Homepage = () => {
    return (
        <div className="homepage-container">
            <div className="glassmorphism-bg">
                <div className="content">
                    <h1>Welcome to Our Travel Bus Booking Website</h1>
                    <p>Discover amazing destinations and book your next journey with us!</p>
                    <img src="bus-image.jpg" alt="Bus" className="bus-image" />
                    <div className="details">
                        <h2>Featured Destination</h2>
                        <p>Explore the scenic beauty of XYZ City with our comfortable bus rides.</p>
                    </div>
                    <div className="animated-slogans">
                        <h3>Book Now for an Unforgettable Experience!</h3>
                        {/* You can add animated slogans here */}
                    </div>
                    <Link to="/Home">
                        <button className="book-now-button">Book Now</button>
                    </Link>
                </div>
            </div>
        </div>
    );
};

export default Homepage;
